That’s So Vintage Market round✌️is happening Aug 26 at AutoShop @unionmarketdc

@libbyandmy is back with 15+ of the ✨BEST✨ local vintage vendors for a one-of-a-kind event! shop curated goods, size + gender inclusive clothes, vinyl records + more. some of your favorite local food + beverage folks will also be on site selling goodies while you shop. 

*NEW* this year, we're asking all attendees to register for one of three shopping sessions to avoid lengthy entrance lines. there are a limited number of VIP early access tickets available for $20. this gives you an opportunity to shop all vendors before the market opens! we’ll also have two free general admission shopping sessions. GA tickets are free, but you must have a ticket to enter the market.

👉visit the link in our bio to register - tickets will go fast!

