The many facets of style in Washington DC & taking a look past the tropes & stereotypes. 

I recently chatted with @bridgetmarieindc on @citycast_dc about what makes DC’s fashion scene special. Many walks of life, the DC locals, the transplants, Queer & Black folks. So many influences in style that make this city special. 

Click the link in my bio or head to http://dc.citycast.fm/ to take a listen!  

