@tanyataylor’s debut store on the Upper East Side at 980 Madison Ave is a true dream come to life!
 From a captivating selection of apparel to a delightful array of items that go beyond the realm of fashion, it’s a stunning showcase of Tanya’s distinctive style and artistry. What truly sets it apart is the wonderful size inclusivity of Tanya Taylor’s designs, catering to sizes from 00 to 22. It’s my hope to see more designers follow in Tanya’s footsteps. 🌟
